omator Integration\";s:7:\"content\";s:351:\"Our new Rich Text field is now live in WPForms Pro! Get fully formatted entries with bold, headings, images, links, and more. Rich text is perfect for blog post submissions and you can let visitors preview their layout before submitting. PLUS: our new Uncanny Automator integration makes it easy to use your forms to trigger your own custom workflows.\";s:4:\"type\";a:1:{i:0;s:4:\"lite\";}s:2:\"id\";i:107;s:4:\"btns\";a:2:{s:4:\"main\";a:2:{s:3:\"url\";s:188:\"https://wpforms.com/introducing-wpforms-1-7-0-rich-text-uncanny-automator/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=Rich Text Lite Learn More\";s:4:\"text\";s:10:\"Learn More\";}s:3:\"alt\";a:2:{s:3:\"url\";s:160:\"https://wpforms.com/wpforms-lite-upgrade/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=Rich Text Lite Get WPForms Pro\";s:4:\"text\";s:15:\"Get WPForms Pro\";}}s:5:\"start\";s:19:\"2021-10-11 00:00:00\";}i:3;a:6:{s:5:\"title\";s:123:\"Now available in WPForms Pro! Accept payments with Square and start making more money through your website’s forms today.\";s:7:\"content\";s:316:\"It’s now easier than ever to take payments through your forms. With our new Square addon, WPForms Pro users can accept orders online using one of the world’s most popular payment service providers. Easily process credit card transactions through your Square account right on your website, with just a few clicks!\";s:4:\"type\";a:1:{i:0;s:4:\"lite\";}s:2:\"id\";i:94;s:4:\"btns\";a:2:{s:4:\"main\";a:2:{s:3:\"url\";s:176:\"https://wpforms.com/introducing-the-new-square-addon-for-wpforms/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=Square Lite Learn More\";s:4:\"text\";s:10:\"Learn More\";}s:3:\"alt\";a:2:{s:3:\"url\";s:157:\"https://wpforms.com/wpforms-lite-upgrade/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=S