INSERT INTO `wp_posts` VALUES (3,1,'2022-01-27 21:52:11','0000-00-00 00:00:00','','Brouillon auto','','auto-draft','open','open','','','','','2022-01-27 21:52:11','0000-00-00 00:00:00','',0,'https://lachaise.ridha-boughediri.students-laplateforme.io/?p=3',0,'post','',0),(4,1,'2022-01-27 21:55:02','2022-01-27 21:55:02','','woocommerce-placeholder','','inherit','open','closed','','woocommerce-placeholder','','','2022-01-27 21:55:02','2022-01-27 21:55:02','',0,'https://lachaise.ridha-boughediri.students-laplateforme.io/wp-content/uploads/2022/01/woocommerce-placeholder.png',0,'attachment','image/png',0),(5,1,'2022-01-27 21:55:03','2022-01-27 21:55:03','','Shop','','publish','closed','closed','','shop','','','2022-01-27 21:55:03','2022-01-27 21:55:03','',0,'https://lachaise.ridha-boughediri.students-laplateforme.io/?page_id=5',0,'page','',0),(6,1,'2022-01-27 21:55:03','2022-01-27 21:55:03','<!-- wp:shortcode -->[woocommerce_cart]<!-- /wp:shortcode -->','Cart','','publish','closed','closed','','cart','','','2022-01-27 21:55:03','2022-01-27 21:55:03','',0,'https://lachaise.ridha-boughediri.students-laplateforme.io/?page_id=6',0,'page','',0),(7,1,'2022-01-27 21:55:03','2022-01-27 21:55:03','<!-- wp:shortcode -->[woocommerce_checkout]<!-- /wp:shortcode -->','Checkout','','publish','closed','closed','','checkout','','','2022-01-27 21:55:03','2022-01-27 21:55:03','',0,'https://lachaise.ridha-boughediri.students-laplateforme.io/?page_id=7',0,'page','',0),(8,1,'2022-01-27 21:55:03','2022-01-27 21:55:03','<!-- wp:shortcode -->[woocommerce_my_account]<!-- /wp:shortcode -->','My account','','publish','closed','closed','','my-account','','','2022-01-27 21:55:03','2022-01-27 21:55:03','',0,'https://lachaise.ridha-boughediri.students-laplateforme.io/?page_id=8',0,'page','',0),(9,1,'2022-01-27 21:55:03','0000-00-00 00:00:00','<!-- wp:paragraph -->\n<p><b>This is a sample page.</b></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h3>Overview</h3>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our refund and returns policy lasts 30 days. If 30 days have passed since your purchase, we can’t offer you a full refund or exchange.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To be eligible for a return, your item must be unused and in the same condition that you received it. It must also be in the original packaging.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Several types of goods are exempt from being returned. Perishable goods such as food, flowers, newspapers or magazines cannot be returned. We also do not accept products that are intimate or sanitary goods, hazardous materials, or flammable liquids or gases.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Additional non-returnable items:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul>\n<li>Gift cards</li>\n<li>Downloadable software products</li>\n<li>Some health and personal care items</li>\n</ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>To complete your return, we require a receipt or proof of purchase.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Please do not send your purchase back to the manufacturer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>There are certain situations where only partial refunds are granted:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul>\n<li>Book with obvious signs of use</li>\n<li>CD, DVD, VHS tape, software, video game, cassette tape, or vinyl record that has been opened.</li>\n<li>Any item not in its original condition, is damaged or missing parts for reasons not due to our error.</li>\n<li>Any item that is returned more than 30 days after delivery</li>\n</ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<h2>Refunds</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Once your return is received and inspected, we will send you an email to notify you that we have received your returned item. We will also notify you of the approval or rejection of your refund.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you are approved, then your refund will be processed, and a credit will automatically be applied to your credit card or original method of payment, within a certain amount of days.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<b>Late or missing refunds</b>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you haven’t received a refund yet, first check your bank account again.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Then contact your credit card company, it may take some time before your refund is officially posted.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Next contact your bank. There is often some processing time before a refund is posted.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you’ve done all of this and you still have not received your refund yet, please contact us at {email address}.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<b>Sale items</b>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Only regular priced items may be refunded. Sale items cannot be refunded.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h2>Exchanges</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We only replace items if they are defective or damaged. If you need to exchange it for the same item, send us an email at {email address} and send your item to: {physical address}.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h2>Gifts</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If the item was marked as a gift when purchased and shipped directly to you, you’ll receive a gift credit for the value of your return. Once the returned item is received, a gift certificate will be mailed to you.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If the item wasn’t marked as a gift when purchased, or the gift giver had the order shipped to themselves to give to you later, we will send a refund to the gift giver and they will find out about your return.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h2>Shipping returns</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To return your product, you should mail your product to: {physical address}.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You will be responsible for paying for your own shipping costs for returning your item. Shipping costs are non-refundable. If you receive a refund, the cost of return shipping will be deducted from your refund.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Depending on where you live, the time it may take for your exchanged product to reach you may vary.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you are returning more expensive items, you may consider using a trackable shipping service or purchasing shipping insurance. We don’t guarantee that we will receive your returned item.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h2>Need help?</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Contact us at {email} for questions related to refunds and returns.</p>\n<!-- /wp:paragraph -->','Refund and Returns Policy','','draft','closed','closed','','refund_returns','','','2022-01-27 21:55:03','0000-00-00 00:00:00','',0,'https://lachaise.ridha-boughediri.students-laplateforme.io/?page_id=9',0,'page','',0),(10,1,'2022-01-27 22:00:31','2022-01-27 22:00:31','<label> Votre nom\n    [text* your-name] </label>\n\n<label> Votre e-mail\n    [email* your-email] </label>\n\n<label> Objet\n    [text* your-subject] </label>\n\n<label> Votre message (facultatif)\n    [textarea your-message] </label>\n\n[submit \"Envoyer\"]\n[_site_title] \"[your-subject]\"\n[_site_title] <wordpress@lachaise.ridha-boughediri.students-laplateforme.io>\nDe : [your-name] <[your-email]>\nObjet : [your-subject]\n\nCorps du message :\n[your-message]\n\n-- \nCet e-mail a été envoyé via le formulaire de contact de [_site_title] ([_site_url])\n[_site_admin_email]\nReply-To: [your-email]\n\n0\n0\n\n[_site_title] \"[your-subject]\"\n[_site_title] <wordpress@lachaise.ridha-boughediri.students-laplateforme.io>\nCorps du message :\n[your-message]\n\n-- \nCet e-mail a été envoyé via le formulaire de contact de [_site_title] ([_site_url])\n[your-email]\nReply-To: [_site_admin_email]\n\n0\n0\nMerci pour votre message. Il a été envoyé.\nUne erreur s’est produite lors de l’envoi de votre message. Veuillez essayer à nouveau plus tard.\nUn ou plusieurs champs contiennent une erreur. Veuillez vérifier et essayer à nouveau.\nUne erreur s’est produite lors de l’envoi de votre message. Veuillez essayer à nouveau plus tard.\nVous devez accepter les termes et conditions avant d’envoyer votre message.\nCe champ est obligatoire.\nLe champ est trop long.\nLe champ est trop court.\nUne erreur inconnue s’est produite lors du téléversement du fichier.\nVous n’avez pas les droits nécessaires pour téléverser ce type de fichier.\nLe fichier est trop volumineux.\nUne erreur s’est produite lors du téléversement du fichier.','Formulaire de contact 1','','publish','closed','closed','','formulaire-de-contact-1','','','2022-01-27 22:00:31','2022-01-27 22:00:31','',0,'https://lachaise.ridha-boughediri.students-laplateforme.io/?post_type=wpcf7_contact_form&p=10',0,'wpcf7_contact_form','',0),(11,1,'2022-01-27 22:03:23','2022-01-27 22:03:23','','Kit par défaut','','publish','closed','closed','','kit-par-defaut','','','2022-01-28 16:26:27','2022-01-28 16:26:27','',0,'https://lachaise.ridha-boughediri.students-laplateforme.io/?p=11',0,'elementor_library','',0),(17,1,'2016-08-22 00:24:31','2016-08-22 00:24:31','<a href=\"#\" role=\"button\">\n						toujours au rdv pour un achat \n					</a>\n			<h2>NOUVELLE TENDANCE</h2>		\n		[products limit=\"12\" orderby=\"date\" order=\"DESC\" columns=\"3\"]','ACCUEIL','','publish','closed','closed','','accueil','','','2022-01-28 18:05:34','2022-01-28 18:05:34','',0,'https://oceanwp.org/simple/?page_id=17',0,'page','',0),(21,1,'2016-08-22 00:37:01